        for token in grammar:
            if token == 'S':
                balance += 1
            elif token[0] == 'T':
                balance += 1
            elif token[0] == 'N':
                balance += 1
            elif token[0] == 'D':
                balance += 1
        return balance == 0

    def generate_string(grammar, input_string):
